import React from 'react';

const Appointment = ({ appointment, onClick }) => {
    return (
        <div className = "speciality" onClick={onClick}>
            <h3>
                Date:
                
                {appointment.date}
                Time:
                {appointment.time}
                Doctor:
                {appointment.doctor.name}
            </h3>
        </div>
    )
};

export default Appointment;
